import React, { Component } from "react";
import data from "./data.json";

function Movie({ match }) {
  const item = objs.find((obj) => obj.action === match.params.title);
  console.log(item);
  return (
    <div className="Movie">
      <h1>Item</h1>
      <h2>{match.params.title}</h2>
    </div>
  );
}

export default Movie;
